// src/pages/HomePage.js
import React from 'react';

const HomePage = () => (
  <div className="p-8 bg-white dark:bg-gray-800 rounded-lg shadow-lg animate-fade-in">
    <h1 className="text-4xl font-bold text-gray-900 dark:text-white mb-4">Welcome to the Home Page</h1>
    <p className="text-lg text-gray-600 dark:text-gray-300">This is the main landing page of our application. From here, you can navigate to other sections using the links in the navigation bar.</p>
  </div>
);

export default HomePage;
